First, let \( \angle CAB = 2\alpha \). Since \( AB = AC \), it follows that \( \angle ABC = \angle ACB = 90^\circ - \alpha \). The angle bisectors of \( \angle CAB \) and \( \angle ABC \) divide these angles into \( \alpha \) and \( 45^\circ - \frac{\alpha}{2} \) respectively.

Since \( K \) is the circumcenter of \( \triangle ADC \), it lies on the perpendicular bisectors of \( AD \), \( DC \), and \( AC \). The perpendicular bisector of \( AC \) is the angle bisector of \( \angle ABC \), which means \( KE \) is the angle bisector of \( \angle ABC \). Therefore, \( \angle BEK = 45^\circ - \frac{\alpha}{2} \). We are given that \( \angle BEK = 45^\circ \), so we have:
\[
45^\circ - \frac{\alpha}{2} = 45^\circ - 45^\circ
\]
\[
45^\circ - \frac{\alpha}{2} = 45^\circ - \frac{2\alpha}{2} = 45^\circ \implies \alpha = 2\alpha
